/*
 *
 * Global Utility Functions
 *
*/
// Recaptcha form
function enableSubmit() {
  $('input[type="submit"]').removeAttr('disabled');
}

$(function() {

  /*
   *
   * Global
   *
  */

  // warn before leaving an internal form with data enterered
  // $('form').areYouSure();
  // $('.animated-form').areYouSure({'silent':true});
  // $(window).on('beforeunload', function(e) {
  //   var customMsg = 'custom test';
  //   if ($('.animated-form').hasClass('dirty')) {
  //       e.returnValue = customMsg;
  //       return customMsg;
  //   }
  // });

  // Required input shade polyfill
  $('.requiredInput input').on('focusin focusout', function(){
    $(this).parents('.shade-container').toggleClass('active');
  });

  // Toggle menu open/closed in site header
  $('body').on('click', '#hamburger-menu', function(e){
    $('body').toggleClass('menu-open');
  });

  // Toggle card flips
  $('.card .flip').click(function(e) {
    e.preventDefault();
    var el = $(this).attr('href');
    $(el).toggleClass('hover');
  });

});

/*
 *
 * FAQs
 *
*/

$(function() {
  $('body').on('click', '.faq .question', function(e) {
    e.preventDefault();
    console.log('clicked');
    var faq = $(this).attr('data-faq-id');
    $('.faq[data-faq-id="' + faq + '"]').toggleClass('open').find('.glyphicon').toggleClass('glyphicon-menu-down').toggleClass('glyphicon-menu-up');
  });
});
/*
 *
 * Rating input
 *
*/
if ($('.rating-input').length > 0) {
  $('.rating-input .glyphicon').click(function() {
    $('.rating-input').toggleClass('open');
  });

  $('.option .rating').click(function() {
    var rating_class = $(this).attr('class'),
        rating = $(this).attr('[data-rating]');

    // Update selected star rating
    $('.selected-rating .rating').attr('class', rating_class);
    $('.rating-input').toggleClass('open');

    // Update input
    $('.desired-rating-input').val(rating);
  });
}
/*
 *
 * Section Nav
 *
*/
$(function() {

  // Set up vars
  var window_offset,
      sections = {};

  // Animate scroll to destination on click
  $('body').on('click', '#section-nav a', function(e){
    
    e.preventDefault();

    // Grab elements locations
    var el = $(this).attr('href'),
        dest = $(el).offset().top;
    // Animate to the destination
    $('html, body').animate({ scrollTop: dest + 'px' });

    // Toggle active classes
    $('#section-nav a').removeClass('active');
    $(this).addClass('active');

  });

  // Set up sections
  function buildSections() {
    $('#section-nav a').each(function() {
      var section_id      = $(this).attr('href'),
          section_offset  = $(section_id).offset().top;
      sections[section_id] = section_offset;
    });
  }

  function setSections() {
    window.setTimeout(function() {
      if(sections != []) {
        buildSections();
      } else {
        setSections();
      }
    }, 250);
  }

  setSections();

  // Sticky nav
  if($('#section-nav').length > 0) {
    var nav_offset = $('#section-nav').offset().top;

    $(window).scroll(function() {
      
      // Reset nav_offset bc it may not be loaded right away
      if(nav_offset === 0) {
        nav_offset = $('#section-nav').offset().top;
      }

      // Set / unset sticky #section_nav based on scroll position
      window_offset = $(window).scrollTop();

      if(window_offset > nav_offset) {
        $('#section-nav').addClass('sticky');
      } else {
        $('#section-nav').removeClass('sticky');
      }

    });

    // When user stops scorlling, re-fresh nav .active state
    var timer,
        active_section;
    // Fire func after scrolling is complete
    $(window).bind('scroll',function () {
        clearTimeout(timer);
        timer = setTimeout( refresh_nav , 150 );
    });

    // Update section_nav with active section
    var refresh_nav = function () {

      var nav_set = false;

      for (var key in sections) {
        if(window_offset + 150 > sections[key]) {
          active_section = key;
          nav_set = true;
        }
      }

      $('#section-nav a').removeClass('active');

      if (nav_set) {
        $('#section-nav a[href="' + active_section + '"]').addClass('active');
      } else {
        $('#section-nav a').first().addClass('active');
      }

    };
  }

});
/*
 *
 * Styled Tables
 *
*/

$(function() {
  // Toggle styled-tables
  $('.styled-table .menu-toggle').click(function(e) {
    e.preventDefault();
    var el = $(this).attr('href');
    $(el).toggleClass('open');
  });

  // Edit/trash styled-tables
  $('.styled-table .glyphicon-edit, .styled-table .glyphicon-trash').click(function(e) {
    e.preventDefault();

    // Grab parent row
    var parent_table_id = $(this).attr('data-parent-table-id'),
        parent_table = '[data-table-id=' + parent_table_id + ']'
        parent_row_id = $(this).attr('data-parent-row-id'),
        parent_row = parent_table + ' [data-row-id=' + parent_row_id + ']';

    // Delete trash
    if ($(this).hasClass('glyphicon-trash')) {
      $(parent_row).remove();
    }

    // Edit row
    if ($(this).hasClass('glyphicon-edit')) {

      // Slide form down
      $('.styled-table-form[data-parent-table-id="' + parent_table_id + '"]').slideDown();

      // Populate form
      $(parent_row + ' td').each(function() {
        var val = $(this).text(),
            name = $(this).attr('data-input-name');

        $('.styled-table-form input:not([type="submit"], [type="reset"]), .styled-table-form select, .styled-table-form textarea').each(function() {
          if($(this).attr('name') === name) {
            $(this).val(val);
          }
        });

      });

    }

  });

  // Add row
  $('.styled-table .add-row').click(function(e) {
    e.preventDefault();

    // Slide form down
    $(this).prev('.styled-table-form').slideDown();

    // Hide button
    $(this).slideUp();

  });

  // Reset "Add row" form
  $('.styled-table [type="reset"]').click(function() {

    // Slide form up
    $(this).closest('.styled-table-form').slideUp().next('.add-row').slideDown();
  });

  // Remove row
  $('.table .remove').click(function(e) {
    e.preventDefault();
    $(this).parent('td').parent('tr').remove();
  });
});
